  RETURNS "pg_catalog"."void" AS $BODY$DECLARE
  _asset1 assets.id%TYPE;
  _asset2 assets.id%TYPE;
  _exchange1 exchanges.id%TYPE;
	_exchange2 exchanges.id%TYPE;

BEGIN
